-- ----------------------------
-- Table structure for plan
-- ----------------------------
DROP TABLE IF EXISTS `plan`;
CREATE TABLE `plan` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `locno` varchar(20) NOT NULL DEFAULT '' COMMENT '仓库编码',
  `customer_no` varchar(30) NOT NULL DEFAULT '' COMMENT '货主编码',
  `order_no` varchar(30) NOT NULL DEFAULT '' COMMENT '单据编号',
  `status` varchar(30) NOT NULL DEFAULT '' COMMENT '状态(10新建、20已审核、30已取消、40已完结)',
  `create_flag` varchar(20) NOT NULL DEFAULT '' COMMENT '创建方式(0:接口下发 1:WMS手工创建 2:WMS自动生成 5-奇门  6-京东)',
  `initiator` varchar(20) NOT NULL DEFAULT '' COMMENT '发起方(1=货主、2=仓库)',
  `service_source` varchar(20) NOT NULL DEFAULT '' COMMENT '服务来源(1=来料、2=库内)',
  `service_reason_code` varchar(30) NOT NULL DEFAULT '' COMMENT '服务原因编号',
  `service_deal_code` varchar(30) NOT NULL DEFAULT '' COMMENT '处理方式编号',
  `exchange_sku` varchar(3) DEFAULT NULL COMMENT '是否更换SKU(0否1是)',
  `product_quality` varchar(3) NOT NULL DEFAULT '' COMMENT '处理结果',
  `is_in_warehouse` varchar(30) DEFAULT NULL COMMENT '在库状态(0=不在库,1=在库)',
  `task_type` varchar(30) DEFAULT NULL COMMENT '作业方式(1=原货位作业,2=修复台作业不上架,3=修复台作业上架)',
  `source_order_no` varchar(30) NOT NULL DEFAULT '' COMMENT '来源单号',
  `plan_box_num` int(9) NOT NULL DEFAULT '0' COMMENT '计划总箱数',
  `plan_pieces_num` int(9) NOT NULL DEFAULT '0' COMMENT '计划总件数',
  `actual_box_num` int(9) NOT NULL DEFAULT '0' COMMENT '实际总箱数',
  `actual_pieces_num` int(9) NOT NULL DEFAULT '0' COMMENT '实际总件数',
  `difference_num` int(9) NOT NULL DEFAULT '0' COMMENT '差异总数',
  `product_type` varchar(3) DEFAULT NULL COMMENT '品类(1鞋，2服装，3包包，4其他)',
  `verify_user_id` varchar(20) DEFAULT NULL COMMENT '审核人id',
  `verify_user_name` varchar(20) DEFAULT NULL COMMENT '审核人名称',
  `verify_time` datetime DEFAULT NULL COMMENT '复核时间时间',
  `create_user_id` varchar(20) NOT NULL COMMENT '创建人id',
  `create_user_name` varchar(20) NOT NULL COMMENT '创建人名称',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_user_id` varchar(20) DEFAULT NULL COMMENT '修改人id',
  `update_user_name` varchar(20) DEFAULT NULL COMMENT '修改人名称',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `del_flag` tinyint(3) NOT NULL DEFAULT '0' COMMENT '删除标识(0-正常,1-删除)',
  `trace_id` varchar(128) DEFAULT NULL COMMENT '日志跟踪id',
  `remarks` varchar(50) DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=190 DEFAULT CHARSET=utf8mb4 COMMENT='增值服务计划单表';

-- ----------------------------
-- Records of plan
-- ----------------------------

-- ----------------------------
-- Table structure for plan_dtl
-- ----------------------------
DROP TABLE IF EXISTS `plan_dtl`;
CREATE TABLE `plan_dtl` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `plan_order_no` varchar(30) NOT NULL COMMENT '增值服务计划单主表编码',
  `customer_no` varchar(30) NOT NULL DEFAULT '' COMMENT '货主编码',
  `zone_no` varchar(30) DEFAULT '' COMMENT '库区名称',
  `roadway` varchar(30) DEFAULT '' COMMENT '巷道名称',
  `location` varchar(30) DEFAULT '' COMMENT '货位',
  `pal_no` varchar(30) DEFAULT NULL COMMENT '托盘号',
  `box_no` varchar(30) DEFAULT NULL COMMENT '箱号',
  `old_sku` varchar(30) NOT NULL DEFAULT '' COMMENT '原SKU',
  `new_sku` varchar(30) NOT NULL DEFAULT '' COMMENT '新SKU',
  `content_id` bigint(20) DEFAULT NULL COMMENT '库存id',
  `content_property_no` varchar(30) NOT NULL DEFAULT '' COMMENT '库存批次号',
  `sub_code` varchar(30) NOT NULL DEFAULT '' COMMENT '库存子件码',
  `product_name` varchar(100) DEFAULT NULL,
  `quality` varchar(3) DEFAULT NULL COMMENT '商品品质 0正品 1次品 2残品',
  `plan_num` int(9) NOT NULL DEFAULT '0' COMMENT '计划数量',
  `actual_num` int(9) NOT NULL DEFAULT '0' COMMENT '实际数量',
  `difference_num` int(9) NOT NULL DEFAULT '0' COMMENT '差异数量',
  `create_user_id` varchar(20) NOT NULL COMMENT '创建人id',
  `create_user_name` varchar(20) NOT NULL COMMENT '创建人名称',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_user_id` varchar(20) DEFAULT NULL COMMENT '修改人id',
  `update_user_name` varchar(20) DEFAULT NULL COMMENT '修改人名称',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `del_flag` tinyint(3) NOT NULL DEFAULT '0' COMMENT '删除标识(0-正常,1-删除)',
  `trace_id` varchar(32) DEFAULT '' COMMENT '日志跟踪id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=258 DEFAULT CHARSET=utf8mb4 COMMENT='增值服务计划单明细表';

